insert into `cdm_time_segment` (id, description, segment, hour, zodiac, office_code, create_by, create_date, update_by, update_date, is_deleted, version) values (REPLACE(uuid(),'-',''), '黄昏，又名日夕、日暮、日晚等：此时太阳已经落山，天将黑未黑。天地昏黄，万物朦胧，故称黄昏。狗开始守门口。', '19:00-20:59', '戌时', '狗', '', 'luxq', now(), 'luxq', now(), 0, 0);
insert into `cdm_time_segment` (id, description, segment, hour, zodiac, office_code, create_by, create_date, update_by, update_date, is_deleted, version) values (REPLACE(uuid(),'-',''), '平旦，又称黎明、早晨、日旦等：时是夜与日的交替之际。老虎在此时最猛。', '03:00-04:59', '寅时', '虎', '', 'luxq', now(), 'luxq', now(), 0, 0);
insert into `cdm_time_segment` (id, description, segment, hour, zodiac, office_code, create_by, create_date, update_by, update_date, is_deleted, version) values (REPLACE(uuid(),'-',''), '日昳，又名日跌、日央等。太阳偏西为日跌。羊在这段时间吃草。', '13:00-14:59', '未时', '羊', '', 'luxq', now(), 'luxq', now(), 0, 0);
insert into `cdm_time_segment` (id, description, segment, hour, zodiac, office_code, create_by, create_date, update_by, update_date, is_deleted, version) values (REPLACE(uuid(),'-',''), '日中，又名日正、中午等。这时候太阳最猛烈，阳气达到极限，阴气将会产生，而马是阴类动物。', '11:00-12:59', '午时', '马', '', 'luxq', now(), 'luxq', now(), 0, 0);
insert into `cdm_time_segment` (id, description, segment, hour, zodiac, office_code, create_by, create_date, update_by, update_date, is_deleted, version) values (REPLACE(uuid(),'-',''), '人定，又名定昏等定，又名定昏等。此时夜色已深，人们也已经停止活动，安歇睡眠了。夜深时分猪正在熟睡。', '21:00-22:59', '亥时', '猪', '', 'luxq', now(), 'luxq', now(), 0, 0);
insert into `cdm_time_segment` (id, description, segment, hour, zodiac, office_code, create_by, create_date, update_by, update_date, is_deleted, version) values (REPLACE(uuid(),'-',''), '哺时，又名日铺、夕食等。猴子喜欢在这时候啼叫。', '15:00-16:59', '申时', '猴', '', 'luxq', now(), 'luxq', now(), 0, 0);
insert into `cdm_time_segment` (id, description, segment, hour, zodiac, office_code, create_by, create_date, update_by, update_date, is_deleted, version) values (REPLACE(uuid(),'-',''), '夜半，又名子夜、中夜，鼠在这时间最活跃。', '23:00-00:59', '子时', '鼠', '', 'luxq', now(), 'luxq', now(), 0, 0);
insert into `cdm_time_segment` (id, description, segment, hour, zodiac, office_code, create_by, create_date, update_by, update_date, is_deleted, version) values (REPLACE(uuid(),'-',''), '隅中，又名日禺等：临近中午的时候称为隅中。蛇在这时候隐蔽在草丛中。', '09:00-10:59', '巳时', '蛇', '', 'luxq', now(), 'luxq', now(), 0, 0);
insert into `cdm_time_segment` (id, description, segment, hour, zodiac, office_code, create_by, create_date, update_by, update_date, is_deleted, version) values (REPLACE(uuid(),'-',''), '日入，又名日落、日沉、傍晚。意为太阳落山的时候。鸡於傍晚开始归巢。', '17:00-18:59', '酉时', '鸡', '', 'luxq', now(), 'luxq', now(), 0, 0);
insert into `cdm_time_segment` (id, description, segment, hour, zodiac, office_code, create_by, create_date, update_by, update_date, is_deleted, version) values (REPLACE(uuid(),'-',''), '日出，又名日始、破晓、旭日等。指太阳刚刚露脸，冉冉初升的那段时间。', '05:00-06:59', '卯时', '兔', '', 'luxq', now(), 'luxq', now(), 0, 0);
insert into `cdm_time_segment` (id, description, segment, hour, zodiac, office_code, create_by, create_date, update_by, update_date, is_deleted, version) values (REPLACE(uuid(),'-',''), '鸡鸣，又名荒鸡，牛在这时候咀嚼白天没消化的食物。', '01:00-02:59', '丑时', '牛', '', 'luxq', now(), 'luxq', now(), 0, 0);
insert into `cdm_time_segment` (id, description, segment, hour, zodiac, office_code, create_by, create_date, update_by, update_date, is_deleted, version) values (REPLACE(uuid(),'-',''), '食时，又名早食等：古人“朝食”之时也就是吃早饭时间。月亮又称玉兔，在这段时间还在天上。相传这是“群龙行雨”的时候。', '07:00-08:59', '辰时', '龙', '', 'luxq', now(), 'luxq', now(), 0, 0);
